import sys

def count_trailing_zeros(n):
    cnt = 0
    d = 5
    while d <= n:
        cnt += n // d
        d *= 5
    return cnt

def solve():
    data = sys.stdin.read().strip()
    if not data:
        return
    m = int(data.strip())
    lo = 0
    hi = 5 * (m + 1)  # upper bound; safe
    # find first n with count >= m
    while lo < hi:
        mid = (lo + hi) // 2
        if count_trailing_zeros(mid) >= m:
            hi = mid
        else:
            lo = mid + 1
    first = lo
    if count_trailing_zeros(first) != m:
        print(0)
        return
    res = []
    for i in range(5):
        if count_trailing_zeros(first + i) == m:
            res.append(first + i)
        else:
            break
    print(len(res))
    if res:
        print(" ".join(map(str, res)))

if __name__ == "__main__":
    solve()

